CREATE VIEW public.audit_trail AS
 SELECT 'SYSTEM_LOG'::text AS source,
    system_logs.id,
    system_logs."timestamp" AS event_time,
    system_logs.level AS severity,
    system_logs.category,
    system_logs.message,
    system_logs.correlation_id,
    system_logs.merchant_id,
    system_logs.environment,
    system_logs.metadata
   FROM public.system_logs
UNION ALL
 SELECT 'SECURITY_EVENT'::text AS source,
    security_events.id,
    security_events."timestamp" AS event_time,
    security_events.severity,
    'SECURITY'::character varying AS category,
    security_events.message,
    security_events.correlation_id,
    security_events.merchant_id,
    NULL::character varying AS environment,
    security_events.metadata
   FROM public.security_events
UNION ALL
 SELECT 'WALLET_OPERATION'::text AS source,
    wallet_operations_log.id,
    wallet_operations_log.created_at AS event_time,
        CASE
            WHEN ((wallet_operations_log.status)::text = 'failed'::text) THEN 'ERROR'::text
            WHEN ((wallet_operations_log.status)::text = 'completed'::text) THEN 'INFO'::text
            ELSE 'INFO'::text
        END AS severity,
    'WALLET_OPERATION'::character varying AS category,
    concat(wallet_operations_log.operation_type, ' - ', wallet_operations_log.status, COALESCE(((' (tx: '::text || wallet_operations_log.tx_hash) || ')'::text), ''::text)) AS message,
    wallet_operations_log.correlation_id,
    wallet_operations_log.merchant_id,
    wallet_operations_log.environment,
    wallet_operations_log.metadata
   FROM public.wallet_operations_log
  ORDER BY 3 DESC;


