CREATE VIEW public.dashboard_metrics AS
 SELECT name,
    category,
    value,
    "timestamp",
    labels,
        CASE
            WHEN ((labels ->> 'success'::text) = 'true'::text) THEN 'success'::text
            WHEN ((labels ->> 'success'::text) = 'false'::text) THEN 'failure'::text
            ELSE 'unknown'::text
        END AS status_category
   FROM public.metrics m
  WHERE ("timestamp" >= (now() - '24:00:00'::interval))
  ORDER BY "timestamp" DESC;


